class NzDemoTransferAdvancedComponent {
    constructor(msg) {
        this.msg = msg;
        this.list = [];
    }
    ngOnInit() {
        this.getData();
    }
    getData() {
        const ret = [];
        for (let i = 0; i < 20; i++) {
            ret.push({
                key: i.toString(),
                title: `content${i + 1}`,
                description: `description of content${i + 1}`,
                direction: Math.random() * 2 > 1 ? 'right' : ''
            });
        }
        this.list = ret;
    }
    reload(direction) {
        this.getData();
        this.msg.success(`your clicked ${direction}!`);
    }
    select(ret) {
        console.log('nzSelectChange', ret);
    }
    change(ret) {
        console.log('nzChange', ret);
    }
}


